        private int[,] reset()
        {
            int[,] designReset = new int[Room.ROOM_WIDTH, Room.ROOM_HEIGHT];
            for (int x = 0; x < Room.ROOM_WIDTH; x++)
                for (int y = 0; y < Room.ROOM_HEIGHT; y++)
                    designReset[x, y] = 0;
            return designReset;
        }

        /// <summary>
        /// Getter for the listing, this returns a List of RoomDesigns from the database.
        /// </summary>
        /// <returns></returns>
        public List<RoomDesign> getListing()
        {
            return listing;
        }


        /// <summary>
        /// Given the room type and room rotation, find a valid room
        /// design with those specifications.
        /// </summary>
        /// <param name="roomType"></param>
        /// <param name="roomRotation"></param>
        /// <returns></returns>
        public int[,] getRoomDesign(int roomType, int roomRotation)
        {
            List<RoomDesign> listOfRoomDesigns = new List<RoomDesign>();
            foreach (RoomDesign design in listing)
            {
                if (design.getRoomType() == roomType)
                    switch (roomType)
                    {
                        case Room.INTERSECTION:
                            listOfRoomDesigns.Add(design);
                            break;
                        case Room.CORRIDOR:

                            /* LEFT and RIGHT corridors are congruent.
                             * UP and DOWN corridors are congruent.
                             */
                            // If the design is for left and right corridor, and we are looking for a left or right corridor, add it.
                            if ((design.getRotation() == Room.LEFT || design.getRotation() == Room.RIGHT) && (roomRotation == Room.LEFT || roomRotation == Room.RIGHT))
                            {
                                listOfRoomDesigns.Add(design);
                            }
                            else if ((design.getRotation() == Room.UP || design.getRotation() == Room.DOWN) && (roomRotation == Room.UP || roomRotation == Room.DOWN))
                            {
                                listOfRoomDesigns.Add(design);
                            }
                            break;
                        default:
                            if (design.getRotation() == roomRotation)
                                listOfRoomDesigns.Add(design);
                            break;

                    }
            }

            Random r = new Random();

            // None found
            if (listOfRoomDesigns.Count == 0)
                return null;

            // Choose any
            RoomDesign selected = listOfRoomDesigns.ElementAt(r.Next(listOfRoomDesigns.Count - 1));
            return selected.getTileDesign();
        }
